/* Append CSRF Tokens to AJAX requests */
$.secureAjax = function(url, settings) {
	if (typeof settings == "undefined") {
		settings = {};
	}
	
	if (typeof settings.data == "undefined") {
		settings.data = {};
	}
	
	settings.data[CSRFTokenField] = CSRFToken;
	
	return this.ajax(url, settings);
};